svg.script:
//
    function load() {
        if(document.defaultView.location.href.indexOf('?')) {
            var params = document.defaultView.location.href
                .split("?")[1]
                .split(String.fromCharCode(38));
            for(var i=0; i<params.length; i++) {
                var param = params[i].split('=');
                var name = param[0];
                var value = param[1];
                switch(name) {
                    case 'angle':
                        var cannonGroup = document.getElementById('cannon-group');
                        cannonGroup.setAttribute('transform', 'translate(66, -8) rotate(' + -value + ')');
                        break;
                }
            }
        }
    }
    setTimeout(load, 10);
//
